import React from 'react'

const About = () => {
    const description = (
        <p>
            I am currently a third year <b>Computer Science</b> student at {" "}
            <a href="https://www.qmul.ac.uk/about/">
                 Queen Mary, University of London
            </a>.
            I am also a part-time Research Analyst Intern at {" "}
            <a href="https://www.abiresearch.com/pages/about-us/">
                ABI Research
            </a>
        </p>
    )

    const interests = (
        <p>
            Outside of work, I'm interested in following the developments
            of science, sports such as Formula 1 and football. I also play
            a lot of video games.
        </p>
    )

    const contact = (
        <p>
            <b>Want to chat?</b> Send me a message at {" "}
            <a href="mailto:larbibelkhit@outlook.com">
                larbibelkhit@outlook.com
            </a> {" "}
            and let's talk.
        </p>
    )

    const tech_stack = [
        "Javascript",
        "Python",
        "React.js",
        "Java",
        "HTML & CSS",
    ]


  return (
    <div className="about-container">
        <div className="about-header">
            <span className="section-title">./ about</span>
        </div>
        <div className="about-content">
            <div className="about-description">
                {[description]}
                {"Here are some technoloies I have been working with:"}
                <ul className="tech-stack">
                    {tech_stack.map(function (tech_item) {
                        return (
                            <li>{tech_item}</li>
                        )
                    })}
                </ul>
                {[interests]}
            </div>
        </div>
    </div>
  )
}

export default About
